"ᴛʜᴀᴛ ꜱʜɪʀᴛ ʟᴏᴏᴋꜱ ɢʀᴇᴀᴛ ᴏɴ ʏᴏᴜ… ᴀꜱ ᴀ ᴍᴀᴛᴛᴇʀ ᴏꜰ ꜰᴀᴄᴛ, ꜱᴏ ᴡᴏᴜʟᴅ ɪ💗💫.",
"ɪꜰ ʏᴏᴜ ʟᴏᴏᴋ ᴛʜᴀᴛ ɢᴏᴏᴅ ɪɴ ᴄʟᴏᴛʜᴇꜱ, ʏᴏᴜ ᴍᴜꜱᴛ ʟᴏᴏᴋ ᴇᴠᴇɴ ʙᴇᴛᴛᴇʀ ᴏᴜᴛ ᴏꜰ ᴛʜᴇᴍ💗💫.",
