"ᴍᴀʏ ʏᴏᴜ ʙᴇ ɢɪꜰᴛᴇᴅ ᴡɪᴛʜ ʟɪꜰᴇ’ꜱ ʙɪɢɢᴇꜱᴛ ᴊᴏʏꜱ ᴀɴᴅ ɴᴇᴠᴇʀ-ᴇɴᴅɪɴɢ ʙʟɪꜱꜱ💫 . ᴀꜰᴛᴇʀ ᴀʟʟ, ʏᴏᴜ ʏᴏᴜʀꜱᴇʟꜰ ᴀʀᴇ ᴀ ɢɪꜰᴛ ᴛᴏ ᴇᴀʀᴛʜ, ꜱᴏ ʏᴏᴜ ᴅᴇꜱᴇʀᴠᴇ ᴛʜᴇ ʙᴇꜱᴛ💫 . ʜᴀᴘᴘʏ ʙɪʀᴛʜᴅᴀʏ💫 .",
"ᴄᴏᴜɴᴛ ɴᴏᴛ ᴛʜᴇ ᴄᴀɴᴅʟᴇꜱ…ꜱᴇᴇ ᴛʜᴇ ʟɪɢʜᴛꜱ ᴛʜᴇʏ ɢɪᴠᴇ💫 . ᴄᴏᴜɴᴛ ɴᴏᴛ ᴛʜᴇ ʏᴇᴀʀꜱ, ʙᴜᴛ ᴛʜᴇ ʟɪꜰᴇ ʏᴏᴜ ʟɪᴠᴇ💫 . ᴡɪꜱʜɪɴɢ ʏᴏᴜ ᴀ ᴡᴏɴᴅᴇʀꜰᴜʟ ᴛɪᴍᴇ ᴀʜᴇᴀᴅ💫 . ʜᴀᴘᴘʏ ʙɪʀᴛʜᴅᴀʏ💫 .",
