"ʙɪʀᴛʜᴅᴀʏꜱ ᴀʀᴇ ᴀ ɴᴇᴡ ꜱᴛᴀʀᴛ, ᴀ ꜰʀᴇꜱʜ ʙᴇɢɪɴɴɪɴɢ ᴀɴᴅ ᴀ ᴛɪᴍᴇ ᴛᴏ ᴘᴜʀꜱᴜᴇ ɴᴇᴡ ᴇɴᴅᴇᴀᴠᴏʀꜱ ᴡɪᴛʜ ɴᴇᴡ ɢᴏᴀʟꜱ💫 . ᴍᴏᴠᴇ ꜰᴏʀᴡᴀʀᴅ ᴡɪᴛʜ ᴄᴏɴꜰɪᴅᴇɴᴄᴇ ᴀɴᴅ ᴄᴏᴜʀᴀɢᴇ💫 . ʏᴏᴜ ᴀʀᴇ ᴀ ᴠᴇʀʏ ꜱᴘᴇᴄɪᴀʟ ᴘᴇʀꜱᴏɴ💫 . ᴍᴀʏ ᴛᴏᴅᴀʏ ᴀɴᴅ ᴀʟʟ ᴏꜰ ʏᴏᴜʀ ᴅᴀʏꜱ ʙᴇ ᴀᴍᴀᴢɪɴɢ🎂 !",
"ʏᴏᴜʀ ʙɪʀᴛʜᴅᴀʏ ɪꜱ ᴛʜᴇ ꜰɪʀꜱᴛ ᴅᴀʏ ᴏꜰ ᴀɴᴏᴛʜᴇʀ 365-ᴅᴀʏ ᴊᴏᴜʀɴᴇʏ💫 . ʙᴇ ᴛʜᴇ ꜱʜɪɴɪɴɢ ᴛʜʀᴇᴀᴅ ɪɴ ᴛʜᴇ ʙᴇᴀᴜᴛɪꜰᴜʟ ᴛᴀᴘᴇꜱᴛʀʏ ᴏꜰ ᴛʜᴇ ᴡᴏʀʟᴅ ᴛᴏ ᴍᴀᴋᴇ ᴛʜɪꜱ ʏᴇᴀʀ ᴛʜᴇ ʙᴇꜱᴛ ᴇᴠᴇʀ💫 . ᴇɴᴊᴏʏ ᴛʜᴇ ʀɪᴅᴇ💫 .",
"ʙᴇ ʜᴀᴘᴘʏ🎂 ! ᴛᴏᴅᴀʏ ɪꜱ ᴛʜᴇ ᴅᴀʏ ʏᴏᴜ ᴡᴇʀᴇ ʙʀᴏᴜɢʜᴛ ɪɴᴛᴏ ᴛʜɪꜱ ᴡᴏʀʟᴅ ᴛᴏ ʙᴇ ᴀ ʙʟᴇꜱꜱɪɴɢ ᴀɴᴅ ɪɴꜱᴘɪʀᴀᴛɪᴏɴ ᴛᴏ ᴛʜᴇ ᴘᴇᴏᴘʟᴇ ᴀʀᴏᴜɴᴅ ʏᴏᴜ🎂 ! ʏᴏᴜ ᴀʀᴇ ᴀ ᴡᴏɴᴅᴇʀꜰᴜʟ ᴘᴇʀꜱᴏɴ🎂 ! ᴍᴀʏ ʏᴏᴜ ʙᴇ ɢɪᴠᴇɴ ᴍᴏʀᴇ ʙɪʀᴛʜᴅᴀʏꜱ ᴛᴏ ꜰᴜʟꜰɪʟʟ ᴀʟʟ ᴏꜰ ʏᴏᴜʀ ᴅʀᴇᴀᴍꜱ🎂 !",
"ʜᴀᴘᴘʏ ʙɪʀᴛʜᴅᴀʏ ✨! ᴍᴀʏ ʏᴏᴜʀ ꜰᴀᴄᴇʙᴏᴏᴋ ᴡᴀʟʟ ʙᴇ ꜰɪʟʟᴇᴅ ᴡɪᴛʜ ᴍᴇꜱꜱᴀɢᴇꜱ ꜰʀᴏᴍ ᴘᴇᴏᴘʟᴇ ʏᴏᴜ ɴᴇᴠᴇʀ ᴛᴀʟᴋ ᴛᴏ 🍰.",
